function Card() {
  return (
    <div className="card">
      <img src="your-image-url.jpg" alt="Profile" />
      <h2>Saurav Sindhwal</h2>
      <p>I'm a web developer and learning HTML, CSS, and JavaScript.</p>
    </div>
  );
}

export default Card;
